						group.time = (group.totalTime / group.count).toFixed(2);
						group.startTiredness = (group.totalBeforeTiredness / group.count).toFixed(2);
						group.endTiredness = (group.totalAfterTiredness / group.count).toFixed(2);
					});
					// group by month
					break;

				case 'Year':
					returnedSleepData.forEach(entry => {
						const key = "" + entry.startYear;

						if(!groupedData[key]) {
							groupedData[key] = {
								totalTime: 0,
								totalBeforeTiredness: 0,
								totalAfterTiredness: 0,
								count: 0,
								date: key
							};
						}

						groupedData[key].totalTime += ((entry.endDay - entry.startDay) * 24 + (entry.endHour - entry.startHour) + (entry.endMinute - entry.startMinute) / 60);
						groupedData[key].totalBeforeTiredness += entry.startTiredness;
						groupedData[key].totalAfterTiredness += entry.endTiredness;
						groupedData[key].count++;
					});

					Object.values(groupedData).forEach(group => {
						group.time = (group.totalTime / group.count).toFixed(2);
						group.startTiredness = (group.totalBeforeTiredness / group.count).toFixed(2);
						group.endTiredness = (group.totalAfterTiredness / group.count).toFixed(2);
					});
					// group by year  
					break;
			}
			console.log(JSON.stringify(groupedData));
			storeValue("filteredSleepData", groupedData);
		})
	}
}

